public class Solution {
    public int PunishmentNumber(int n) {
        int sum = 0;
        for (int i = 1; i <= n; i++) {
            int square = i * i;
            string squareStr = square.ToString();
            for (int len = 1; len <= squareStr.Length; len++) {
                for (int start = 0; start <= squareStr.Length - len; start++) {
                    int partSum = 0;
                    int part = int.Parse(squareStr.Substring(start, len));
                    partSum += part;
                    for (int end = start + len; end <= squareStr.Length; end += len) {
                        if (end < squareStr.Length) {
                            part = int.Parse(squareStr.Substring(end, len > squareStr.Length - end ? squareStr.Length - end : len));
                            partSum += part;
                        }
                        if (partSum == i && (end >= squareStr.Length || len == squareStr.Length)) {
                            sum += square;
                            start = squareStr.Length; // Break outer loop
                            break; // Break inner loop
                        }
                    }
                }
            }
        }
        return sum;
    }
}
